import React, { Component } from 'react'
 
class Address extends Component {
    
    constructor(props) {
        super(props)
    
        this.state = {
             Address: "Address",
             City: "City",
             County: "County",
             State: "State"
        }
    }
    
    onAddressChange(e) {
        this.props.handleTextResponse(e.target.value);
    }
    
    render() {
        return (
            <div>
                <div>
                    <label htmlFor="addressanswer">{this.state.Address}</label>
                    <input className="addressanswer" type="text" value={this.props.value} onInput={this.onAddressChange}></input>
                </div>
            </div>
        )
    }
}

export default Address
